INSERT INTO `places` (`id`,`location`,`category`,`name`,`description`,`photo`) VALUES 
 (1,'Pondicherry','Park','Bharathi Park','Landscaped park featuring a Greco-Roman arch structure, plus flowers, a play area & fountains.\r\nAddress: 20, Rue Saint Gilles Street, White Town, Puducherry, 605001',),
 (2,'Pondicherry','Park','Kokku Park','Kokku Park is located at East Coast Road, Puducherry, PY - 605008. Besides this park, there are eight more parks listed in Puducherry.',);
INSERT INTO `places` (`id`,`location`,`category`,`name`,`description`,`photo`) VALUES 
 (3,'Chennai','Park','Guindy National park','Guindy National Park is a 2.70 km2 (1.04 sq mi) protected area of Tamil Nadu, located in Chennai, India, is the 8th-smallest National Park of India and one of the very few national parks situated inside a city. The park is an extension of the grounds surrounding Raj Bhavan, formerly known as the \'Guindy Lodge\', the official residence of the Governor of Tamil Nadu, India. It extends deep inside the governor\'s estate, enclosing beautiful forests, scrub lands, lakes and streams.',),
 (4,'Chennai','Restaurant','The Marina Restaurant','Environmentally-conscious restaurant plating sustainable Indian & Chinese style seafood.\r\nService options: Dine-in  Takeaway  No-contact delivery\r\nAddress: 39, College Road, Nungambakkam, Chennai, Tamil Nadu 600006',);
INSERT INTO `places` (`id`,`location`,`category`,`name`,`description`,`photo`) VALUES 
 (5,'Pondicherry','Restaurant','Rendezvous Cafe Restaurant','Stylish colonial restaurant preparing distinctive coastal dishes highlighting unique local flavours.\r\nAddress: 30, Rue, Suffren St, Puducherry, 605001',),
 (6,'Chennai','Museum','Government Museum','The Government Museum, Chennai, or the Madras Museum, is a museum of human history and culture located in the Government Museum Complex in the neighbourhood of Egmore in Chennai, India. Wikipedia\r\nAddress: Government Maternity Hospital, Pantheon Rd, Egmore, Chennai, Tamil Nadu 600008',);
INSERT INTO `places` (`id`,`location`,`category`,`name`,`description`,`photo`) VALUES 
 (7,'Madurai','Museum','Gandhi Memorial Museum','Gandhi Memorial Museum, established in 1959, is a memorial museum for Gandhi located in the city of Madurai in Tamil Nadu, India. Known as Gandhi Museum, it is now one of the five Gandhi Sanghralayas in the country.',),
 (8,'Vellore','Historical Buildings','Vellore Fort','Vellore Fort is a large 16th-century fort situated in heart of the Vellore city, in the state of Tamil Nadu, India built by Vijayanagara kings. The fort was at one time the headquarters of the Aravidu Dynasty of the Vijayanagara Empire. The fort is known for its grand ramparts, wide moat and robust masonry.',);
INSERT INTO `places` (`id`,`location`,`category`,`name`,`description`,`photo`) VALUES 
 (9,'Chennai','Historical Buildings','The Ripon Building','The Ripon Building is the seat and headquarters of the Greater Chennai Corporation in Chennai, Tamil Nadu. It is an example of neoclassical architecture, a combination of Ionic and Corinthian styles. The Ripon Building is an all-white structure and is located near the Dr. M.G.R Railway Station.',),
 (10,'Chennai','Beach','Marina Beach','Marina Beach is a natural urban beach in Chennai, Tamil Nadu, India, along the Bay of Bengal. The beach runs from near Fort St. George in the north to Foreshore Estate in the south, a distance of 6.0 km, making it the longest natural urban beach in the country',);
INSERT INTO `places` (`id`,`location`,`category`,`name`,`description`,`photo`) VALUES 
 (11,'Pondicherry','Beach','Promenade Beach','Rock Beach is the popular stretch of beachfront in the city of Puducherry, India, along the Bay of Bengal. It is a 1.2-kilometre-long stretch in Pondicherry, starts from War Memorial and end at Dupleix Park on the Goubert Avenue',);
